import Strategie from "./Strategie";
import Header from "./Header";
import Vulnerability from "./Vulnerability";
import Fasi from "./Fasi";

function Sidebar() {
  return (
    <div className="sidebar">
      <Header></Header>
      <Strategie></Strategie>
      <Vulnerability></Vulnerability>
      <Fasi></Fasi>
    </div>
  );
}

export default Sidebar;
